import { Text, View, Image } from 'react-native'
import React, { Component } from 'react'

export class Landing extends Component {
  render() {
    return (
      <View
        style={{ flex: 1,
            justifyContent: "center",
            alignItems: "center"}}
      >
         <Image
              resizeMode="cover"
              style={{
                height: 220,
                width: 250,
              }}
              source={require("../../../assets/splash.png")}
            />
      </View>
    )
  }
}

export default Landing
